(10, 'code implementation', 'C = 100\nfor i = 1 to n do\n    for j = 1 to n do\n    {\n        Temp = A[i][j] + C\n        A[i][j] = A[j][i]\n        A[j][i] = Temp - C\n    } \nfor i = 1 to n do\n    for j = 1 to n do\n        Output(A[i][j]);', '_38ft1whqq', 'clike', '2019-06-30 07:43:20', '2019-06-30 07:43:20'),
(11, 'link list', 'void fun1(struct node* head)\n{\n  if(head == NULL)\n    return;\n  \n  fun1(head->next);\n  printf(\"%d  \", head->data);\n}', '_5iwu57dwp', 'clike', '2019-06-30 07:50:40', '2019-06-30 07:50:40'),
(12, 'reverse linked list', '/* Link list node */\nstruct node\n{\n    int data;\n    struct node* next;\n};\n \n/* head_ref is a double pointer which points to head (or start) pointer \n  of linked list */\nstatic void reverse(struct node** head_ref)\n{\n    struct node* prev   = NULL;\n    struct node* current = *head_ref;\n    struct node* next;\n    while (current != NULL)\n    {\n        next  = current->next;  \n        current->next = prev;   \n        prev = current;\n        current = next;\n    }\n    /*ADD A STATEMENT HERE*/\n}', '_buo3nzql7', 'java', '2019-06-30 07:55:59', '2019-06-30 07:55:59'),
(13, 'print node', 'void fun(struct node* start)\n{\n  if(start == NULL)\n    return;\n  printf(\"%d  \", start->data); \n  \n  if(start->next != NULL )\n    fun(start->next->next);\n  printf(\"%d  \", start->data);\n}', '_kzf234t5n', 'java', '2019-06-30 07:59:21', '2019-06-30 07:59:21'),
(14, 'order of operation in java', 'double x = 2;\ndouble y = 3;\ndouble z = 5;\n\ndouble output = x + x * y + (x + 2 * z);\n\nSystem.out.println(output);', '_lm0hh1z5o', 'java', '2019-06-30 09:07:44', '2019-06-30 09:07:44'),
